import React, { Component } from "react";

class StoreCapability extends Component {
  render() {
    return (
      <div>
        <div class="card mb-3">
          <div class="card-body">
              <h3>Store Capabilities</h3>
          </div>
        </div>
      </div>
    );
  }
}

export default StoreCapability;
